MongoDB: sum values in object without MapReduce<p>I have a collections of objects:</p>

<pre><code>{
    "_id" : "01",
    "properties" : {
        "colors" : {
            "red" : 0.8891772,
            "blue" : 0.7580757,
            "green" : 0.4345628,
            "white" : 0.7373822,
            "black" : 0.93228924,
            ...
            "purple" : 0.83328924,
    }
}
</code></pre>

<p>Colors has many more keys that was shown above. Also, not every object has exactly the same keys, e.g. an object may not have properties.colors.red at all.</p>

<p>I need to sum the values of the color keys so that the output looks:</p>

<pre><code>/* 1 */
{
    "key" : "Red",
    "value" : 2723.1982
}

/* 2 */
{
    "key" : "Blue",
    "value" : 972172.271
}

...
</code></pre>

<p>Where the values are the sum of the values for that color.</p>

<p><strong>EDIT</strong></p>

<p>In fact, better than just the sum for each properties.colors would be the average of the sums over the total number of documents in the original collections.</p>

<p>So for example:</p>

<pre><code>{
    "_id" : "01",
    "properties" : {
        "colors" : {
            "red" : 2.0,
            "blue" : 4.0,
    }
}

{
    "_id" : "02",
    "properties" : {
        "colors" : {
            "red" : 2.0,
            "black" : 8.0,
    }
}
</code></pre>

<p>Should result in:</p>

<pre><code>/* 1 */
{
    "key" : "red",
    "value" : 2.0
}

/* 2 */
{
    "key" : "blue",
    "value" : 2.0
}

/* 3 */
{
    "key" : "black",
    "value" : 4.0
}
</code></pre>

