Update a property of a mongoose schema through POST request<p>I want to update a user's location when the user authenticates itself.</p>

<p>The property <code>city</code> needs to be updated when the user POST the API route /login.</p>

<p>I cannot seem to figure out how to update the schema as I tried multiple solutions on stack already. Could someone please help me out </p>

<p>POST request: constains the api route /login</p>

<pre><code>router.post('/login',cors(), async (req, res) =&gt; {
try {
const { email, password, city } = req.body;
if (!isEmail(email)) {
  return res.status(400).json({
    errors: [
      {
        title: 'Bad Request',
        detail: 'Email must be a valid email address',
      },
    ],
  });
}
if (typeof password !== 'string') {
  return res.status(400).json({
    errors: [
      {
        title: 'Bad Request',
        detail: 'Password must be a string',
      },
    ],
  });
}
const user = await User.findOne({ email });
if (!user) {
  throw new Error();
}

const userId = user._id;
user.update({
  city: req.user.city
},{
  $set: { 
    "User.city": req.body.city
  }
}, function (err, user) {
    if (err) throw error
    console.log(user)
    console.log("update user complete")
});

const passwordValidated = await bcrypt.compare(password, user.password);
if (!passwordValidated) {
  throw new Error();
}

const session = await initSession(userId);

res
  .cookie('token', session.token, {
    httpOnly: true,
    sameSite: true,
    maxAge: 1209600000,
    secure: process.env.NODE_ENV === 'production',
  })
  .json({
    title: 'Login Successful',
    detail: 'Successfully validated user credentials',
    csrfToken: session.csrfToken,
    token: session.token,
    city : user.city
  });
} catch (err) {
res.status(401).json({
  errors: [
    {
      title: 'Invalid Credentials',
      detail: 'Check email and password combination',
      errorMessage: err.message,
    },
  ],
  });
 }
});
</code></pre>

<p>UserSchema: this is the mongoose schema of the user</p>

<pre><code>const mongoose = require('mongoose');
const uniqueValidator = require('mongoose-unique-validator');
const bcrypt = require('bcryptjs');

const UserSchema = new mongoose.Schema({
 email: {
  type: String,
  required: true,
  minlength: 1,
  trim: true,
  unique: true,   //each registered email must be unique
},
 password: {
  type: String,
  required: true,
  minlength: 8,
 },
  city:{
  type: String,
 },

 module.exports = mongoose.model('User', UserSchema);
</code></pre>

